import React from "react";

const UserDashboard = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>User Dashboard</h1>
      <p>Welcome to your dashboard!</p>
    </div>
  );
};

export default UserDashboard;
